class Solution:
    def minimumEffortPath(self, heights: list) -> int:
        min_effort = [[float('inf') for _ in range(len(heights[0]))] for _ in range(len(heights))]
        min_effort[0][0] = 0
        h = len(heights)
        w = len(heights[0])
        to_visit = [[0, 0]]

        def update(j, i):
            if i + 1 < w:
                new_val = max(min_effort[j][i], abs(heights[j][i + 1] - heights[j][i]))
                if new_val < min_effort[j][i + 1]:
                    min_effort[j][i + 1] = new_val
                    to_visit.append([j, i + 1])
            if i - 1 >= 0:
                new_val = max(min_effort[j][i], abs(heights[j][i - 1] - heights[j][i]))
                if new_val < min_effort[j][i - 1]:
                    min_effort[j][i - 1] = new_val
                    to_visit.append([j, i - 1])
            if j + 1 < h:
                new_val = max(min_effort[j][i], abs(heights[j + 1][i] - heights[j][i]))
                if new_val < min_effort[j + 1][i]:
                    min_effort[j + 1][i] = new_val
                    to_visit.append([j+1, i])
            if j - 1 >= 0:
                new_val = max(min_effort[j][i], abs(heights[j - 1][i] - heights[j][i]))
                if new_val < min_effort[j - 1][i]:
                    min_effort[j - 1][i] = new_val
                    to_visit.append([j-1, i])

        i = 0
        while i < len(to_visit):
            update(to_visit[i][0], to_visit[i][1])
            i += 1

        return min_effort[-1][-1]


